import React from "react";
import bannerImage from "./commonBanner.jpeg";
import "./commonBanner.css";
import { redirect } from "react-router-dom";
class CommonBanner extends React.Component {
  render() {
    const commonBannerStyle = {
      backgroundImage: "url(./commonBanner.jpeg)",
      backgroundColor: redirect,
      position: "absolute",
      zIndex: -1,
      top: 0,
      left: 0,
    };
    return (
      <section style={commonBannerStyle}>
        <img className="commonBannerImage" src={bannerImage}></img>
      </section>
    );
  }
}
export default CommonBanner;
